package counter_demo

import (
	"strconv"
)

var (
	count int
)

func Increment() {
	count++
}

func GetCount() int {
	return count
}

func Render(path string) string {
	return "# Counter Realm\n\nThe current count is: **" + strconv.Itoa(count) + "**\n"
}

