package counter

import (
	"strconv"
)

var count int = 0

// Increment increments the counter.
// We take a string argument and return a string.
// This signature is widely tested in Gno realms as a crossing entry point.
func Increment(dummy string) string {
	count++
	return "Counter is now " + strconv.Itoa(count)
}

func GetCount() int {
	return count
}

func Render(path string) string {
	return "# Counter Realm\n\nThe current count is: **" + strconv.Itoa(count) + "**\n"
}

